import React, { Component } from 'react';
import {Link} from 'react-dom';

class Notifcation extends Component{

render(){
  return(
    <div>
      <nav>
          <ul>
            <li>
              <Link to={"/notification"}>
              Notification
              </Link>
            </li>
          </ul>
        </nav>
    </div>
  )
}

}
export default Notifcation;
